import React, { useEffect, useState } from "react";
import { useLocation, useNavigate } from "react-router-dom";
import TheatreSeatGenerator from "./TheatreSeatGenerator";
import standardSeatLayout from "../data/TheatreSeat";
import '../style/TheatreLayout.css';

const TheatreLayout = () => {
  const location = useLocation();
  const navigate = useNavigate();

  console.log("final theatre data")
  const [theatreData, setTheatreData] = useState(location.state?.theatreData || null)
  
  useEffect(() => {
    if (!theatreData) {
      fetchTheatreData();
    }
  }, [theatreData]);
  
  const fetchTheatreData = async () => {
    try {
      const response = await fetch("/api/theatre/all", {method: "Get"}); // Adjust API endpoint
      const data = await response.json();
      setTheatreData(data);
    } catch (error) {
      console.error("Error fetching theatre data:", error);
    }
  };
  



  const [selectedSeats, setSelectedSeats] = useState([]);

  const handleSeatSelect = (seatNumber) => {
    setSelectedSeats((prevSelectedSeats) => {
      if (prevSelectedSeats.includes(seatNumber)) {
        return prevSelectedSeats.filter((seat) => seat !== seatNumber);
      } else {
        return [...prevSelectedSeats, seatNumber];
      }
    });
  };
  const handlePayment = async () => {
    console.log("Payment button clicked!");
    try {
      const response = await fetch("http://localhost:3800/api/book", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({
          userId: "user123",
          movieTitle: theatreData.movieTitle,
          theatreName: theatreData.theatreName,
          showTime: theatreData.showTime,
          seatNumbers: selectedSeats,
          totalPrice: selectedSeats.length * 200,
        }),
      });

      console.log("Response status:", response.status);

      if (!response.ok) {
        throw new Error("Failed to generate ticket");
      }

      const ticketData = await response.json();
      console.log("Received ticket data:", ticketData);

      navigate("/Ticket", { state: { ticket: ticketData } });

    } catch (error) {
      console.error("Payment error:", error);
    }
  };


  const finalTheatreData = theatreData;

  console.log("Final Theatre Data:", finalTheatreData);

  return (
    <div className="theatre-layout">
      <h2>{finalTheatreData.theatreName}</h2>

      <div className="seat-section premium">
        <h3>Premium</h3>
        <TheatreSeatGenerator
          seatData={finalTheatreData.availableSeats.premium.rowA}
          rowLabel="A"
          seatType="premium"
          bookedSeats={finalTheatreData.bookedSeats}
          selectedSeats={selectedSeats}
          onSeatSelect={handleSeatSelect}
        />
        <TheatreSeatGenerator
          seatData={finalTheatreData.availableSeats.premium.rowB}
          rowLabel="B"
          seatType="premium"
          bookedSeats={finalTheatreData.bookedSeats}
          selectedSeats={selectedSeats}
          onSeatSelect={handleSeatSelect}
        />
      </div>

      <div className="seat-section regular">
        <h3>Regular</h3>
        <TheatreSeatGenerator
          seatData={finalTheatreData.availableSeats.regular.rowC}
          rowLabel="C"
          seatType="regular"
          bookedSeats={finalTheatreData.bookedSeats}
          selectedSeats={selectedSeats}
          onSeatSelect={handleSeatSelect}
        />
        <TheatreSeatGenerator
          seatData={finalTheatreData.availableSeats.regular.rowD}
          rowLabel="D"
          seatType="regular"
          bookedSeats={finalTheatreData.bookedSeats}
          selectedSeats={selectedSeats}
          onSeatSelect={handleSeatSelect}
        />
      </div>

      <div className="seat-section recliner">
        <h3>Recliner</h3>
        <TheatreSeatGenerator
          seatData={finalTheatreData.availableSeats.recliner.rowF}
          rowLabel="F"
          seatType="recliner"
          bookedSeats={finalTheatreData.bookedSeats}
          selectedSeats={selectedSeats}
          onSeatSelect={handleSeatSelect}
        />
      </div>

      {selectedSeats.length > 0 && (
        <button className="generate-ticket-btn" onClick={handlePayment}>
          Pay
        </button>
      )}
    </div>
  );
};

export default TheatreLayout;
